import Head from "next/head";

import { ItemsTable } from "react-monday-ui";

const Home = () => (
  <>
    <div className="container">
      <ItemsTable />
    </div>

    <style jsx>{`
      .container {
        max-width: 1200px;
        padding: 0 0.5rem;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
      }
    `}</style>
  </>
);

export default Home;
